webpackJsonp([0x626f0eb2693a],{1094:function(e,n){e.exports={data:{package:{id:"json-r",score:.6056248626876132,name:"json-r",version:"2.3.0",description:"A BuckleScript lib for handling JSON in `Result` favor, written in [ReasonML](http://facebook.github.io/reason/).",keywords:["json","bucklescript"],license:"MIT",updated:"2018-01-02T10:47:34.446Z",stars:7,type:"published",quality:.8132412881916082,popularity:.033497671712432196,maintenance:.9997951175165127,readme:'<h1>JsonR</h1>\n<p>A BuckleScript lib for handling JSON in <code>Result</code> favor, written in <a href="http://facebook.github.io/reason/">ReasonML</a>.</p>\n<h2>Usage</h2>\n<p>Add <code>json-r</code> to your project\'s dependencies by <code>yarn</code> or <code>npm</code>, And add it to <code>bs-dependencies</code> for <code>bsconfig.json</code>, e.g.</p>\n<pre><code class="language-json">{\n    "name": "coolproj",\n    "bs-dependencies": [\n      "json-r"\n    ]\n}\n</code></pre>\n<h3>Basic example</h3>\n<pre><code class="language-reason">open JsonR.Json;\nopen Js_result;\n\nlet json = parse_result json_source;\n\n/* Access a field and its value, return a Js_result type */\n\nlet title = json |> string_for "title";\n\n/* or more verbose */\nlet title = json |> member "title" |> to_string;\n\n\n/* you can also pass key path */\nlet age = json |> int_for "author.age";\n\n/ * or */\nlet age = json |> member "author.age" |> to_int;\n\nswitch age {\n| Ok a => DoWhatYouWant a\n| Error e => HeyWeCantParseOutTheAge_CheckTheErrorMessage e\n};\n</code></pre>\n<p>You can open <code>__tests__/test.re</code> to view more examples.</p>\n<h3>Advance usage</h3>\n<p>Need to use the another <code>Result</code> type such as <code>Containers.Result</code>? Just <code>Module Json = JsonR.Impl Containers.Result;</code>.</p>\n<h2>LICENSE</h2>\n<p>MIT.</p>\n',homepageUrl:"https://github.com/cxa/JsonR",repositoryUrl:"https://github.com/cxa/JsonR",npmUrl:"https://www.npmjs.com/package/json-r",issuesUrl:"https://github.com/cxa/JsonR/issues",slug:"packages/json-r"}},pathContext:{id:"json-r"}}}});
